import React from "react";
import macimg1 from "../containers/icons/macimg1.png";
import macimg2 from "../containers/icons/macimg2.png";
import macimg3 from "../containers/icons/macimg3.png";
import macimg4 from "../containers/icons/macimg4.png";
import macimg5 from "../containers/icons/macimg5.png";
import macimg6 from "../containers/icons/macimg6.png";
import { CardWrapper, Wrapper } from "./catalog.styled";
import CardItem from "../components/cardItem";
import Item from "./product";

let data = [
  {
    id:1,
    title: "Apple MacBook Pro 14",
    text: "Space Gray M2 Pro 16/512 10CPU 16GPU (MPHE3) 2023",
    image: macimg1,
    price: "2,225",
  },
  {
    id:2,
    title: "Apple MacBook Air 13",
    text: "M1 8/256 7GPU Silver Late 2020 (MGN93)",
    image: macimg2,
    price: "967",
  },
  {
    id:3,
    title: "Apple MacBook Pro 13",
    text: "Space Gray M2 8/256 2022 (MNEH3)",
    image: macimg3,
    price: "1,377",
  },
  {
    id:4,
    title: "Apple iMac M3 24",
    text: "4.5K 8GPU/8RAM/256GB Silver (MQR93) 2023",
    image: macimg4,
    price: "4,573",
  },
  {
    id:5,
    title: "Apple MacBook Pro 14",
    text: "Space Black M3 Pro 18/512 11CPU 14GPU (MRX33) 2023",
    image: macimg5,
    price: "2,262",
  },
  {
    id:6,
    title:"Apple MacBook Pro 16",
    text:'Space Gray M1 Pro 16/1TB 16GPU (MK193) 2021',
    image: macimg6,
    price:"2,119",
  },
];

function Catalog() {
  return (
    <Wrapper>
    <div style={{ width: "auto", height: "auto", backgroundColor: "white" }}>
      <CardWrapper>
        {data.map((Item, i) => {
          return (
          <CardItem key={i}id={Item.id} 
          title={Item.title} 
          text = {Item.text} 
          image = {Item.image}
           price={Item.price}/>
          )


  })}
      </CardWrapper>
    </div>
    </Wrapper>
  );
}

export default Catalog;
